      fetch(URL)
      .then(res => res.json())
      .then(allContractors => this.setState({allContractors}))
    }


    render() {

        return (
          <div >

              <Route exact 
                path="/contractors/:id"
                render={(props) =>{  

                  <ContractorShowPage

